import React from "react";
import "./Button.css";

interface ButtonProps {
  title: string;
  type: string;
  action: () => void;
  fill: string;
}
export const Button = ({ title, type, action, fill }: ButtonProps) => {
  const onButtonClick = () => {
    action();
  };

  return (
    <button
      onClick={onButtonClick}
      className={`button__${type}`}
      style={
        fill ? { backgroundColor: "rgb(255, 78, 80)", color: "#fff" } : ""
      }
    >
      {title}
    </button>
  );
};
